import { useState } from "react";
import { Redirect } from "react-router-dom";

const AccountCard= props =>{
    var [redirect,setRedirect] = useState(false)
    return(
        <div class="card m-2" style={{width: '12rem'}}>
            {redirect?<Redirect to={'Account/' + props.AccId + 'Payment'}/>:''}
            <div class="card-body">
                <h5 class="card-title">{props.schemeName}</h5>
                <p class="card-text">{props.desc}</p>
                <button onClick={()=>props.paymentDisplayHandler(props.AccId)} class="btn btn-danger">Show Payment Details</button>
                <button onClick={()=>setRedirect(true)} className='btn btn-primary mt-1'>History</button>
            </div>
        </div>
    );
}

export default AccountCard;
